export default WorldMap


const AddressCard = ({ white,showAddress, setShowAddress }) => {
  let nodePosition = 0;
  const ref = useRef()
  const [hoveredItem, setHoveredItem] = useState(false)


  useEffect(() => {
    if (showAddress) {
      let arr = ARR_OF_ADRESS.filter((item) => item.id === showAddress)
      if (arr && arr.length > 0) {
        setHoveredItem(arr[0])
      }

      const el = document.getElementById(showAddress)
      if (el) {
        nodePosition = el.getBoundingClientRect();
        const popupElement = document.getElementById("popup")
        popupElement.style.top = `${nodePosition.top.toFixed(0) - 10}px`
        popupElement.style.left = `${nodePosition.left.toFixed(0)}px`
      }
    }
  }, [showAddress])



  return (

    <div ref={ref} id="popup" className={`w-[250px] min-h-[100px] py-4 text-sm z-30 fixed  rounded-t-lg rounded-br-lg px-4  translate-y-[-100%] ${white?"bg-white text-secondary":"bg-black text-white"} shadow-lg`}>

      <div className="w-full h-full relative">
        {hoveredItem.location}
      </div>
    </div>
  )
}